import React from 'react';
import '../App.css'
import Profile from '.'

const ProfileReview = ({ profileReviews }) =>
    <div className="profile" >
    {(profileReviews || []).map(profile =>
        <Profile 
         key ={profile.objectId}
        profile={profile}
        />
    )}
</div>

  export default ProfileReview;
